/** @jsxImportSource theme-ui */
import React from "react";
import { Grid, Label, Box, Input, Textarea, Button, Flex, Image, Text } from "theme-ui";
import Xlogo from '../../assets/x-logo.png';

const ReviewBoxes = (props) => {
    return (
        <Flex sx={{ backgroundColor: 'navy50', px: '10px', py: '30px', borderRadius: '10px', mb: '20px', flexDirection: 'column' }}>


            <Flex sx={{flexDirection: 'column'}}>
                <Text
                    sx={{
                        color: 'navy0',
                        fontWeight: '700',
                        fontSize: 3,
                        mb: '10px'
                    }}>
                    Project Name: {props.projectName}
                </Text>

                <Text sx={{fontSize: 2, fontWeight: '700', mb: '10px'}}>
                    {props.body}
                </Text>

                <Image src={Xlogo} sx={{maxWidth: '20px'}}/>

            </Flex>

            Rating: {props.rating}
            Author: {props.author}
        </Flex>
    )
}

export default ReviewBoxes;
